summary.p:
The manuscript is the progenitor of the richest branch of the textual tradition in terms of number of descendants, and six preserved manuscripts are direct copies of it (see the stemma in Kassel 1971): Vatican City, Bibliotheca Apostolica Vaticana, Palatinus gr. 23 (sigled Z);
Vatican City, Bibliotheca Apostolica Vaticana, Vaticanus gr. 1340 (Y); Oxford, Bodleian Library, MS Baroccianus 133 ; Madrid, Biblioteca Nacional de España, Matr. 4684 (de Andrés 134);
Paris, Bibliothèque nationale de France, grec 2038 (D); Florence, Biblioteca Medicea Laurenziana, Laur. Plut. 31.14.
